import React from "react";
import { useSelector, useDispatch } from "react-redux";
import { useEffect } from "react";
// import catchPokemonAction from "../actions";
import { retrieveCaughtPokemonAction } from "../actions/catchPokemonAction";

const MyPokemonPage = ({ retrieveCaughtPokemonAction, userId }) => {
  useEffect(() => {
    retrieveCaughtPokemonAction(userId);
  }, []);
  
  
}

function MyPokemon({ userId }) {
  const dispatch = useDispatch();
  // Assuming your Redux store has a 'myPokemon' slice that contains the caught Pokémon
  // const caughtPokemon = useSelector((state) => state.myPokemon);
  let pokemonCaught = [];
  dispatch(retrieveCaughtPokemonAction(userId)).then((res) => {
    pokemonCaught = res;
    console.log("pokemonCaught", pokemonCaught);
  });
  // console.log("pokemonCaught", pokemonCaught);
  // console.log("caughtPokemon", caughtPokemon);
//   {
//     "_id": "65cd7b0a3e795402ca3a88df",
//     "pokemon_name": "psyduck",
//     "pokemon_id": 54,
//     "url_to_sprite": "https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/54.png",
//     "caught_by_user": "65cba2679d12ad1f42441cef",
//     "__v": 0
// }
  return (
    <div>
      <h1>My Pokémon</h1>
      <ul>
        {pokemonCaught.map((pokemon) => (
          <li key={pokemon._id}>
            {pokemon.caught_by_user}
            {pokemon.pokemon_name}
            {pokemon.url_to_sprite};
          </li>
        ))}
      </ul>
      

    </div>
  );
}

export default MyPokemon;
